import React from "react";
import { Outlet } from "react-router-dom";
import { Header } from "../../components";

const Public = () => {
  return (
    <div className="w-ful flex justify-center">
      <div className="w-ful flex justify-center">
        <Header />
      </div>
      <div className="w-main">
        <Outlet />
      </div>
    </div>
  );
};

export default Public;
